PERAN UTAMA:
â¢ Merancang dan mempromosikan kegiatan untuk memenuhi permintaan pelanggan dan menghasilkan pendapatan;
â¢ Mengiklankan dan mempromosikan klub atau Pusat untuk meningkatkan penggunaan, dengan mempertimbangkan riset pasar;

Merekrut, melatih, dan mengawasi staf, termasuk mengelola rotasi staf;

Menerima laporan harian/mingguan/bulanan dari Manajer Kebugaran, Tim Penjualan Kepala Tata Graha dan Kepala Pimpinan;

Melaksanakan pemeriksaan kesehatan dan keselamatan pada peralatan dan lokasi;

Mempertahankan anggota yang ada dengan memberikan layanan berkualitas baik dan memberikan penjualan yang baik program;
â¢ Memprioritaskan kegiatan sasaran dan kelompok pengguna (terutama di Pusat otoritas lokal);
â¢ Hubungan Pelanggan;
â¢ Memberikan pelatihan kepada staf penjualan untuk Menangani pertanyaan, keluhan dan keadaan darurat
â¢ Memberikan pelatihan kebugaran atau pembinaan dalam kegiatan olahraga - sering kali merupakan cara yang baik untuk menjaga kontak dengan pelanggan;
â¢ Menyiapkan dan memeriksa anggaran dan menghasilkan pendapatan;

Mencatat dan menyimpan stok suplemen;

Memanfaatkan studio Group-X dengan menjadwalkan batch grouper yang menarik;

Menulis laporan bulanan atau mingguan dan menyiapkan proyeksi kas untuk pemilik Pusat;

Meningkatkan keuntungan dengan menyelenggarakan dan memberikan berbagai kegiatan/program kebugaran yang sesuai;

Menyimpan catatan statistik dan keuangan; Mengawasi pemeliharaan peralatan kebugaran & fasilitas lainnya; â¢ Memastikan kepatuhan terhadap peraturan kesehatan dan keselamatan; â¢ Menjaga standar layanan pelanggan, kebugaran & perhotelan; â¢ Perencanaan;
â¢ Melaksanakan tugas administratif;
â¢ Mempromosikan dan memasarkan bisnis;
perusahaan - Endurance Fitness Club
